import { api_key, url } from "../Global"

const FetchGenres = () => {
  const genres = fetch(`${url}/genre/movie/list?api_key=${api_key}&language=en-US`)
  .then(res => {
    return res.json()
  })
  .then()

  return genres.json();
}

export default FetchGenres;
